"""
A solution to a ROSALIND bioinformatics problem.
Problem Title: Find All Shared k-mers of a Pair of Strings
Rosalind ID: BA6E
URL: http://rosalind.info/problems/ba6e/
"""
def complement(text):
    """complement of text"""
    compl=""
    nt = len(text)
    for i in range (0,nt):
        if text[i]=="G":
            compl=compl+"C"
        if text[i]=="C":
            compl=compl+"G"
        if text[i]=="A":
            compl=compl+"T"
        if text[i]=="T":
            compl=compl+"A"
    return compl

def reverse(text):
    """reverse of text"""
    return text[::-1]

def Lwindows(text,L):
    """list of all L-windows in text"""
    windows=list()
    for i in range (0,len(text)-L+1):
        windows.append(kmer(text,i,L))
    return windows

def kmer(text, i, k):
    """substring of text from i-th position for the next k letters"""
    return text[i:(i+k)]

def Shared(k,string1,string2):
    wind1=Lwindows(string1,k)
    wind2=Lwindows(string2,k)
    l=[]
    l=[(i, j)  for i, x in enumerate(wind1) for j, y in enumerate(wind2) if x == y or x==reverse(complement(y))]
    return l

if __name__ == '__main__':
    x = '''3
AAACTCATC
TTTCAAATC'''
    inlines = x.split("\n")
    k = int(inlines[0])
    string1 = inlines[1]
    string2 = inlines[2]
    res = Shared(k, string1, string2)
    for r in res:
        print(r)

